@kaaier inference with `yolov3.weights` works as intended. I literally just showed you the code to run. **Copy and paste the exact code and you will see the same results.**

@WannaSeaU @Jaiczay everything works as intended as long as you limit yourself to 1 GPU. I'm on travel today so won't be able to debug further until tomorrow. The issue probably has to do with the padding/collating of the targets (DataLoader requires all 16 target Tensors to have the same shape). I suspect its possible the targets are not arriving in the correct order under multiGPU + multiple workers.

For now 1 GPU + 4 workers is the fastest correct implementation (the current commit default).
